import React from 'react';

import { ContentBlock, ContentItemHeader, ContentItemBody } from './styles';

const Content = ({ children }) => {
  return (
    <ContentBlock>
      <ContentItemHeader />
      <ContentItemBody>{children}</ContentItemBody>
    </ContentBlock>
  );
};

export default Content;
